import React from 'react';
import './TransferSummary.css';

/**
 * Transfer Summary Component
 * Displays summary of non-taxable transfers detected in the transaction data
 */
const TransferSummary = ({ transferAnalysis }) => {
  if (!transferAnalysis || !transferAnalysis.summary) {
    return null;
  }

  const { summary } = transferAnalysis;
  const total = summary.total || 0;
  const transfers = summary.transfers || 0;
  const taxable = summary.taxable || 0;
  const transferPercentage = summary.transfer_percentage || 0;

  if (total === 0) {
    return null;
  }

  return (
    <div className="transfer-summary">
      <div className="transfer-header">
        <h3>üîÑ Transfer Detection</h3>
        <p className="subtitle">Automatic identification of non-taxable wallet movements</p>
      </div>

      <div className="transfer-stats">
        <div className="transfer-stat-card primary">
          <div className="stat-icon">üîÑ</div>
          <div className="stat-content">
            <div className="stat-value">{transfers}</div>
            <div className="stat-label">Non-Taxable Transfers</div>
          </div>
        </div>

        <div className="transfer-stat-card">
          <div className="stat-icon">üí∞</div>
          <div className="stat-content">
            <div className="stat-value">{taxable}</div>
            <div className="stat-label">Taxable Transactions</div>
          </div>
        </div>

        <div className="transfer-stat-card">
          <div className="stat-icon">üìä</div>
          <div className="stat-content">
            <div className="stat-value">{transferPercentage}%</div>
            <div className="stat-label">Transfer Rate</div>
          </div>
        </div>
      </div>

      {transfers > 0 && (
        <div className="transfer-info-box">
          <div className="info-icon">‚ÑπÔ∏è</div>
          <div className="info-content">
            <h4>What are Non-Taxable Transfers?</h4>
            <p>
              Transfers are crypto movements between your own wallets or exchanges without selling. 
              These are <strong>not taxable events</strong> because:
            </p>
            <ul>
              <li>No disposal (sale) occurred</li>
              <li>Ownership did not change</li>
              <li>No capital gain or loss is realized</li>
            </ul>
            <p className="detected-info">
              The system detected <strong>{transfers} transfer{transfers !== 1 ? 's' : ''}</strong> that will be excluded from your capital gains calculation.
            </p>
          </div>
        </div>
      )}

      {transfers === 0 && (
        <div className="no-transfers-box">
          <div className="no-transfers-icon">‚úì</div>
          <div className="no-transfers-content">
            <h4>No Transfers Detected</h4>
            <p>All transactions appear to be taxable events (buys, sells, or trades).</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default TransferSummary;
